import logo from "./logo.svg";
import "./App.css";

import {useState} from "react";

function App() {

  const [title, setTitle] = useState("");
  const [description, setDescription] = useState("");



  return (
    <div className="App">
      <form onClick= {(e)=> e.preventDefault()} >
        <input className="title" id="titleField" placeholder="Title" value={title} onChange={(e)=> setTitle(e.target.value)} />
        <br></br>
        <input className="description" id="descriptionField" placeholder="description" value={description} onChange={(e)=> setDescription(e.target.value)} />
        <br></br>
        <button>Submit</button>
      </form>
    </div>
  );
}

export default App;
